import React from 'react';

const SideDesign = () => {
  const containerStyle = {
    fontFamily: 'Arial, sans-serif',
    margin: 0,
    padding: 0,
    backgroundColor: '#f4f4f4',
  };

  const headerStyle = {
    padding: '20px',
    textAlign: 'left',
    backgroundColor: '#3498db',
    color: '#3A9188',
  };

  const h1Style = {
    margin: 0,
    fontSize: '36px',
  };

  const pStyle = {
    margin: '5px 0 0',
    fontSize: '14px',
    color: '#000000',
  };

  return (
   <></>
  );
};

export default SideDesign;
